import React from 'react';
import './Navigation.css';
import Timer from './Timer'

function Navigation() {
    return (
        <fieldset>
        <Timer />
        <hr/>
        <ul>
          <li><a href="localhost:3000">HOME</a></li>
          <li><a href="/">PROFILE</a></li>
          <li><a href="https://github.com/GaeTaeng?tab=repositories">github</a></li>
          <li><a href="https://www.linkedin.com/in/tae-hun-kim-434552168/">LinkedIn</a></li>
        </ul>
        </fieldset>
    )
  }
  

  export default Navigation
